import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css'; // Estilos globais
import Header from './components/Header';
import Footer from './components/Footer';
import Sidebar from './components/Sidebar'; // Se você usar a sidebar
import ProductList from './components/ProductList'; // Caso precise mostrar a lista de produtos

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Header />
    <Sidebar /> {/* Se você for usar a sidebar */}
    <ProductList products={[]} /> {/* Adicione um array de produtos aqui */}
    <Footer />
  </React.StrictMode>
);
